宜蘭城隍廟為兩進兩廊傳統閩南式廟宇建築，其兩廊空間為奉祀六房科（吏部、戶部、禮部、兵部、刑部、工部）之處，因此做成護室或廂房型態。兩廊外牆以附壁柱區分成中央與兩側三個部分。中央柱間較兩側寬，中間開門，且施以深紅色底之門聯，門兩側下方裙堵貼附大理石堵，上方身堵採馬約利卡磁磚。門上方有人物戲齣泥塑剪黏水車堵，以小塊玫瑰圖案馬約利卡磁磚為框。兩側柱間較小，下方裙堵為大理石堵，主要牆面中間開八卦形窗，嵌以鑄鐵花窗；其他牆面貼附以馬約利卡磁磚。上方水車堵同樣施以人物戲齣泥塑剪黏。

